 22.0  # 50\\r\",\"k_meso      = 1.0 # 10\\r\",\"\\r\",\"C_pKLK0     = 1.0E-10\\r\",\"C_KLK0      = 0\\r\",\"C_Ltotal    = 1.0E-10\\r\",\"C_meso      = 1.0E-10\\r\",\"V           = 2.3E-6 #human: 5.8E-7, mouse: 2.3E-6\\r\",\"sigmoid_a   = 200\\r\",\"dpi_set     = 100 \\r\",\"\\r\",\"def generate_cmap(colors):\\r\",\"    values = range(len(colors))\\r\",\"    vmax = np.ceil(np.max(values))\\r\",\"    color_list = []\\r\",\"    for v, c in zip(values, colors):\\r\",\"        color_list.append( ( v/ vmax, c) )\\r\",\"    return LinearSegmentedColormap.from_list('custom_cmap', color_list)\\r\",\"\\r\",\"class ODE(object):\\r\",\"    def __init__(self, diff_eq, init_con):\\r\",\"        self.diff_eq  = diff_eq\\r\",\"        self.init_con = init_con\\r\",\"        \\r\",\"    def cal_equation(self, x_end, k_deg, k_auto, k_meso):\\r\",\"        dx = 0.001 # resolution of x\\r\",\"        N = round(x_end/dx) + 1 #total steps of x\\r\",\"        x = np.linspace(0, x_end, N) # prepare range of x\\r\",\"        v = odeint(self.diff_eq, self.init_con, x, rtol=1e-13, atol=1e-19, args=(k_deg, k_auto, k_meso))\\r\",\"        return v\\r\",\"\\r\",\"x_res = 0.001 # resolution of x\\r\",\"x = np.arange(-0.1, 1.01, x_res) # x: height. 0 \\u003c x \\u003c 1\\r\",\"\\r\",\"# basic functions\\r\",\"@jit('f8[:](f8[:],f8,f8)', nopython=True)\\r\",\"def sigmoid(x, a, b):\\r\",\"    return 1 / (1 + np.exp(-a * (x - b))) #a: slope, b: inflection point\\r\",\"@jit('f8(f8,f8,f8)', nopython=True)\\r\",\"def sigmoid_p(x, a, b):\\r\",\"    return 1 / (1 + np.exp(-a * (x - b))) #a: slope, b: inflection point\\r\",\"\\r\",\"#def exp_fit(x,y):\\r\",\"#    def exp_residual(param, x1, y1):\\r\",\"#            residual = np.log(y1) - (np.log(param[0]) + param[1] * x1)\\r\",\"#            return residual\\r\",\"#    r1    =  leastsq(exp_residual, [1,1], args=(x, y))\\r\",\"#    return r1[0][0], r1[0][1]\\r\",\"#\\r\",\"#def poly6_fit(x,y):\\r\",\"#    def poly6_residual(param, x1, y1):\\r\",\"#            residual = y1 - (param[0]*x1**6 + param[1]*x1**5 + param[2]*x1**4 + param[3]*x1**3 + param[4]*x1**2 + param[5]*x1**1 + param[6])\\r\",\"#            return residual\\r\",\"#    r1    =  leastsq(poly6_residual, [0,0,0,0,0,0,0], args=(x, y))\\r\",\"#    return r1[0][0], r1[0][1], r1[0][2], r1[0][3], r1[0][4], r1[0][5], r1[0][6]\\r\",\"#\\r\",\"#def poly3_fit(x,y):\\r\",\"#    def poly3_residual(param, x1, y1):\\r\",\"#            residual = y1 - (param[0]*x1**3 + param[1]*x1**2 + param[2]*x1**1 + param[3])\\r\",\"#            return residual\\r\",\"#    r1    =  leastsq(poly3_residual, [0,0,0,0,0], args=(x, y))\\r\",\"#    return r1[0][0], r1[0][1], r1[0][2], r1[0][3], r1[0][4]\\r\",\"\\r\",\"# pH, KD, pHact functions\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pH7_5(x):       #conventional\\r\",\"    a = 7 - 1.6*x \\r\",\"    a = np.where(a \\u003e 7, 7, a)\\r\",\"    return a\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pH5(x):       # assume Tmem79 KO mice\\r\",\"    return 6.2 - 0.8*np.sign(x)\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pH7(x):         # assume Claudin-1 KO mice\\r\",\"    return 7 -x*0\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pH5_7step(x):\\r\",\"    return 7 - sigmoid(x, sigmoid_a, 0)*1 - sigmoid(x, sigmoid_a, 0.3)*0.6 + sigmoid(x, sigmoid_a, 0.8)*1.3\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pH5_7step1(x):\\r\",\"    return 7 - sigmoid(x, sigmoid_a, 0)*1.6 + sigmoid(x, sigmoid_a, 0.8)*1.3\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pH757v(x):      \\r\",\"    a = 5.4 + 3.2*np.abs(x-0.5) \\r\",\"    a = np.where(a \\u003e 7, 7, a)\\r\",\"    a = np.where(x \\u003e 0.5, a - 0.6*(x-0.5), a)\\r\",\"    return a\\r\",\"\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pH7_5_p(x):       #conventional\\r\",\"    a = 7 - 1.6*x \\r\",\"    if a\\u003e7:\\r\",\"        a=a\\r\",\"    else:\\r\",\"        a=7\\r\",\"    return a\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pH5_p(x):       # assume Tmem79 KO mice\\r\",\"    return 6.2 - 0.8*np.sign(x)\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pH7_p(x):         # assume Claudin-1 KO mice\\r\",\"    return 7 -x*0\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pH5_7step_p(x):\\r\",\"    return 7 - sigmoid_p(x, sigmoid_a, 0)*1 - sigmoid_p(x, sigmoid_a, 0.3)*0.6 + sigmoid_p(x, sigmoid_a, 0.8)*1.3\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pH5_7step1_p(x):\\r\",\"    return 7 - sigmoid_p(x, sigmoid_a, 0)*1.6 + sigmoid_p(x, sigmoid_a, 0.8)*1.3\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pH757v_p(x):\\r\",\"    a = 5.4 + 3.2*np.abs(x-0.5) \\r\",\"    if a \\u003e 7:\\r\",\"        a = 7\\r\",\"    if x \\u003e 0.5:\\r\",\"        a = a - 0.6*(x-0.5)\\r\",\"    return a\\r\",\"\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def ka_KLK5(pH):\\r\",\"#    x      = np.array([4.5,\\t    5.5,\\t6.5,\\t7.5])\\r\",\"#    y      = np.array([9.91E+03,\\t3.06E+04,\\t3.44E+04,\\t5.71E+04])\\r\",\"#    a, b    = exp_fit(x,y)\\r\",\"    a   = 1107.2170512153116\\r\",\"    b   = 0.5370835922533095\\r\",\"    ka      = a*np.exp(b*pH)\\r\",\"    return ka\\r\",\"\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def kd_KLK5(pH):\\r\",\"#    x      = np.array([4.5,\\t    5.5,\\t6.5,\\t7.5])\\r\",\"#    y      = np.array([8.04E-04,\\t3.38E-05,\\t1.83E-06,\\t8.70E-08])\\r\",\"#    a, b    = exp_fit(x,y)\\r\",\"    a   = 641.5660425153252\\r\",\"    b   = -3.0310484112381295\\r\",\"    kd  = a*np.exp(b*pH)\\r\",\"    return kd\\r\",\"\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def pHact_KLK5(pH):\\r\",\"#    x  = np.array([4.1, 4.4, 4.7, 5.0, 5.3, 5.6, 5.8, 6.0, 6.2, 6.4, 6.6, 6.8, 7.0, 7.2, 7.4, 7.6, 7.8, 8.0])\\r\",\"#    y  = np.array([0.068, 0.056,0.082,0.121,0.153,0.215,0.255,0.336,0.368,0.423,0.513,0.604,0.687,0.802,0.851,0.946,1.000,0.918])\\r\",\"#    a, b, c, d, e, f, g = poly6_fit(x, y)\\r\",\"    a = -0.004746254429466693\\r\",\"    b = 0.1589424238008589\\r\",\"    c = -2.194742504812747\\r\",\"    d = 15.993391066635198\\r\",\"    e = -64.7859033497406\\r\",\"    f = 138.16196094242454\\r\",\"    g = -121.04562652656601\\r\",\"    pHact   = a*pH**6 + b*pH**5 + c*pH**4 + d*pH**3 + e*pH**2 + f*pH**1 + g\\r\",\"    return pHact\\r\",\"\\r\",\"@jit('f8[:](f8[:])', nopython=True)\\r\",\"def pHact_KLK5_l(pH):\\r\",\"#    x  = np.array([4.1, 4.4, 4.7, 5.0, 5.3, 5.6, 5.8, 6.0, 6.2, 6.4, 6.6, 6.8, 7.0, 7.2, 7.4, 7.6, 7.8, 8.0])\\r\",\"#    y  = np.array([0.068, 0.056,0.082,0.121,0.153,0.215,0.255,0.336,0.368,0.423,0.513,0.604,0.687,0.802,0.851,0.946,1.000,0.918])\\r\",\"#    a, b, c, d, e, f, g = poly6_fit(x, y)\\r\",\"    a = -0.004746254429466693\\r\",\"    b = 0.1589424238008589\\r\",\"    c = -2.194742504812747\\r\",\"    d = 15.993391066635198\\r\",\"    e = -64.7859033497406\\r\",\"    f = 138.16196094242454\\r\",\"    g = -121.04562652656601\\r\",\"    pHact   = a*pH**6 + b*pH**5 + c*pH**4 + d*pH**3 + e*pH**2 + f*pH**1 + g\\r\",\"    return pHact\\r\",\"\\r\",\"@jit('f8(f8)', nopython=True)\\r\",\"def mesotrypsin_act(pH):\\r\",\"#    x          = np.array([4.1, 4.4 ,4.7 ,5.0 ,5.3 ,5.6 ,5.8 ,6.0 ,6.2 ,6.4 ,6.6 ,6.8 ,7.0 ,7.2 ,7.4 ,7.6 ,7.8 ,8.0])\\r\",\"#    y          = np.array([0.283,0.330,0.412,0.532,0.622,0.711,0.701,0.742,0.852,0.828,0.859,0.903,0.883,0.948,0.948,1.000,1.000,0.963])\\r\",\"#    a, b, c, d    = poly3_fit(x,y)\\r\",\"#    meso_act   = a*pH**3 + b*pH**2 + c*pH**1 + d\\r\",\"    a   = -0.0031336145910445218\\r\",\"    b   = 0.01660872174079904\\r\",\"    c   = 0.3405034981494503\\r\",\"    d   = -1.199922472107838\\r\",\"    meso_act   = a*pH**3 + b*pH**2 + c*pH**1 + d\\r\",\"    return meso_act\\r\",\"\\r\",\"@jit('f8[:](f8[:],f8,f8,f8,f8,)', nopython=True)\\r\",\"def diff_pH5_7step(c, x, k_deg, k_auto, k_meso):  # c: conc. of [pKLK, KLK, LEKTI, K-L compelx], x: height\\r\",\"    pH          = pH5_7step_p(x)\\r\",\"    ka          = ka_KLK5(pH)\\r\",\"    kd          = kd_KLK5(pH)\\r\",\"    a_KLK       = pHact_KLK5(pH)\\r\",\"    a_meso      = mesotrypsin_act(pH)\\r\",\"    dpKLKdt     = -c[0]/V*(k_auto*a_KLK*c[1] + k_meso*a_meso*C_meso)\\r\",\"    dKLKdt      = 1/V* (c[0]*(k_auto*a_KLK*c[1]  + k_meso*a_meso*C_meso)\\\\\\r\",\"                        - ka*c[1]*c[2] + kd*c[3] + k_deg*a_meso*C_meso*c[3])\\r\",\"    dLEKTIdt    = 1/V*( - ka*c[1]*c[2] + kd*c[3] - k_deg*a_meso*C_meso*c[2]) \\r\",\"    dComplexdt  = 1/V*(   ka*c[1]*c[2] - kd*c[3] - k_deg*a_meso*C_meso*c[3])\\r\",\"    results_all = np.array([dpKLKdt, dKLKdt, dLEKTIdt, dComplexdt])\\r\",\"    return results_all\\r\",\"\\r\",\"@jit('f8[:](f8[:],f8,f8,f8,f8,)', nopython=True)\\r\",\"def diff_pH7_5(c, x, k_deg, k_auto, k_meso):  # c: conc. of [pKLK, KLK, LEKTI, K-L compelx], x: height\\r\",\"    pH          = pH7_5_p(x)\\r\",\"    ka          = ka_KLK5(pH)\\r\",\"    kd          = kd_KLK5(pH)\\r\",\"    a_KLK       = pHact_KLK5(pH)\\r\",\"    a_meso      = mesotrypsin_act(pH)\\r\",\"    dpKLKdt     = -c[0]/V*(k_auto*a_KLK*c[1] + k_meso*a_meso*C_meso)\\r\",\"    dKLKdt      = 1/V* (c[0]*(k_auto*a_KLK*c[1]  + k_meso*a_meso*C_meso)\\\\\\r\",\"                        - ka*c[1]*c[2] + kd*c[3] + k_deg*a_meso*C_meso*c[3])\\r\",\"    dLEKTIdt    = 1/V*( - ka*c[1]*c[2] + kd*c[3] - k_deg*a_meso*C_meso*c[2]) \\r\",\"    dComplexdt  = 1/V*(   ka*c[1]*c[2] - kd*c[3] - k_deg*a_meso*C_meso*c[3])\\r\",\"    results_all = np.array([dpKLKdt, dKLKdt, dLEKTIdt, dComplexdt])\\r\",\"    return results_all\\r\",\"\\r\",\"@jit('f8[:](f8[:],f8,f8,f8,f8,)', nopython=True)\\r\",\"def diff_pH5_7step1(c, x, k_deg, k_auto, k_meso):  # c: conc. of [pKLK, KLK, LEKTI, K-L compelx], x: height\\r\",\"    pH          = pH5_7step1_p(x)\\r\",\"    ka          = ka_KLK5(pH)\\r\",\"    kd          = kd_KLK5(pH)\\r\",\"    a_KLK       = pHact_KLK5(pH)\\r\",\"    a_meso      = mesotrypsin_act(pH)\\r\",\"    dpKLKdt     = -c[0]/V*(k_auto*a_KLK*c[1] + k_meso*a_meso*C_meso)\\r\",\"    dKLKdt      = 1/V* (c[0]*(k_auto*a_KLK*c[1]  + k_meso*a_meso*C_meso)\\\\\\r\",\"                        - ka*c[1]*c[2] + kd*c[3] + k_deg*a_meso*C_meso*c[3])\\r\",\"    dLEKTIdt    = 1/V*( - ka*c[1]*c[2] + kd*c[3] - k_deg*a_meso*C_meso*c[2]) \\r\",\"    dComplexdt  = 1/V*(   ka*c[1]*c[2] - kd*c[3] - k_deg*a_meso*C_meso*c[3])\\r\",\"    results_all = np.array([dpKLKdt, dKLKdt, dLEKTIdt, dComplexdt])\\r\",\"    return results_all\\r\",\"\\r\",\"@jit('f8[:](f8[:],f8,f8,f8,f8,)', nopython=True)\\r\",\"def diff_pH5(c, x, k_deg, k_auto, k_meso):  # c: conc. of [pKLK, KLK, LEKTI, K-L compelx], x: height\\r\",\"    pH          = pH5_p(x)\\r\",\"    ka          = ka_KLK5(pH)\\r\",\"    kd          = kd_KLK5(pH)\\r\",\"    a_KLK       = pHact_KLK5(pH)\\r\",\"    a_meso      = mesotrypsin_act(pH)\\r\",\"    dpKLKdt     = -c[0]/V*(k_auto*a_KLK*c[1] + k_meso*a_meso*C_meso)\\r\",\"    dKLKdt      = 1/V* (c[0]*(k_auto*a_KLK*c[1]  + k_meso*a_meso*C_meso)\\\\\\r\",\"                        - ka*c[1]*c[2] + kd*c[3] + k_deg*a_meso*C_meso*c[3])\\r\",\"    dLEKTIdt    = 1/V*( - ka*c[1]*c[2] + kd*c[3] - k_deg*a_meso*C_meso*c[2]) \\r\",\"    dComplexdt  = 1/V*(   ka*c[1]*c[2] - kd*c[3] - k_deg*a_meso*C_meso*c[3])\\r\",\"    results_all = np.array([dpKLKdt, dKLKdt, dLEKTIdt, dComplexdt])\\r\",\"    return results_all\\r\",\"\\r\",\"@jit('f8[:](f8[:],f8,f8,f8,f8,)', nopython=True)\\r\",\"def diff_pH7(c, x, k_deg, k_auto, k_meso):  # c: conc. of [pKLK, KLK, LEKTI, K-L compelx], x: height\\r\",\"    pH          = pH7_p(x)\\r\",\"    ka          = ka_KLK5(pH)\\r\",\"    kd          = kd_KLK5(pH)\\r\",\"    a_KLK       = pHact_KLK5(pH)\\r\",\"    a_meso      = mesotrypsin_act(pH)\\r\",\"    dpKLKdt     = -c[0]/V*(k_auto*a_KLK*c[1] + k_meso*a_meso*C_meso)\\r\",\"    dKLKdt      = 1/V* (c[0]*(k_auto*a_KLK*c[1]  + k_meso*a_meso*C_meso)\\\\\\r\",\"                        - ka*c[1]*c[2] + kd*c[3] + k_deg*a_meso*C_meso*c[3])\\r\",\"    dLEKTIdt    = 1/V*( - ka*c[1]*c[2] + kd*c[3] - k_deg*a_meso*C_meso*c[2]) \\r\",\"    dComplexdt  = 1/V*(   ka*c[1]*c[2] - kd*c[3] - k_deg*a_meso*C_meso*c[3])\\r\",\"    results_all = np.array([dpKLKdt, dKLKdt, dLEKTIdt, dComplexdt])\\r\",\"    return results_all\\r\",\"\\r\",\"@jit('f8[:](f8[:],f8,f8,f8,f8,)', nopython=True)\\r\",\"def diff_pH757v(c, x, k_deg, k_auto, k_meso):  # c: conc. of [pKLK, KLK, LEKTI, K-L compelx], x: height\\r\",\"    pH          = pH757v_p(x)\\r\",\"    ka          = ka_KLK5(pH)\\r\",\"    kd          = kd_KLK5(pH)\\r\",\"    a_KLK       = pHact_KLK5(pH)\\r\",\"    a_meso      = mesotrypsin_act(pH)\\r\",\"    dpKLKdt     = -c[0]/V*(k_auto*a_KLK*c[1] + k_meso*a_meso*C_meso)\\r\",\"    dKLKdt      = 1/V* (c[0]*(k_auto*a_KLK*c[1]  + k_meso*a_meso*C_meso)\\\\\\r\",\"                        - ka*c[1]*c[2] + kd*c[3] + k_deg*a_meso*C_meso*c[3])\\r\",\"    dLEKTIdt    = 1/V*( - ka*c[1]*c[2] + kd*c[3] - k_deg*a_meso*C_meso*c[2]) \\r\",\"    dComplexdt  = 1/V*(   ka*c[1]*c[2] - kd*c[3] - k_deg*a_meso*C_meso*c[3])\\r\",\"    results_all = np.array([dpKLKdt, dKLKdt, dLEKTIdt, dComplexdt])\\r\",\"    return results_all\\r\",\"\\r\",\"\\r\",\"# --- Range of kdeg to reproduce qualitative distribution of LEKTI ---\\r\",\"def fR_Ltotal_pH757(k_deg):\\r\",\"    ode      = ODE(diff_pH5_7step, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim      = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    R_Ltotal = (sim[1000, 2] + sim[1000, 3])/sim[0, 2]\\r\",\"    return R_Ltotal\\r\",\"\\r\",\"def fR_Ltotal_pH75(k_deg):\\r\",\"    ode      = ODE(diff_pH7_5, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim      = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    R_Ltotal = (sim[1000, 2] + sim[1000, 3])/sim[0, 2]\\r\",\"    return R_Ltotal\\r\",\"\\r\",\"def fR_Ltotal_pH757v(k_deg):\\r\",\"    ode      = ODE(diff_pH757v, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim      = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    R_Ltotal = (sim[1000, 2] + sim[1000, 3])/sim[0, 2]\\r\",\"    return R_Ltotal\\r\",\"\\r\",\"def C_total_kdeg_plot(R_Ltotal, Title, kdeg_min, kdeg_max, kdeg_range):\\r\",\"    df = pd.DataFrame({'k_deg'    : kdeg_range,\\r\",\"                       'R_Ltotal' : R_Ltotal})\\r\",\"    fig, ax = plt.subplots(figsize = (3,3), dpi=300)\\r\",\"    sns.lineplot(data = df, x='k_deg', y='R_Ltotal')\\r\",\"#    ax.set(xlabel ='k_deg (s-1)',ylabel='C_Ltotal(1)/C_Ltotal(0) (-)',\\\\\\r\",\"    ax.set(xlabel ='k_deg (s-1)',ylabel='C_Ltotal(1)/C_Ltotal(0) (-)',\\\\\\r\",\"           xlim=(np.min(kdeg_range), np.max(kdeg_range)), ylim=(0.000001,1))\\r\",\"    plt.vlines(kdeg_min, 0, 0.5, \\\"gray\\\", linestyles='dashed') \\r\",\"    plt.hlines(0.5, 0, kdeg_min, \\\"gray\\\", linestyles='dashed')\\r\",\"    plt.vlines(kdeg_max, 0, 0.0001, \\\"gray\\\", linestyles='dotted') \\r\",\"    plt.hlines(0.0001, 0, kdeg_max, \\\"gray\\\", linestyles='dotted')\\r\",\"#    ax.set_xscale(\\\"log\\\") \\r\",\"    ax.set_yscale(\\\"log\\\")  \\r\",\"#    ax.set_xticks(np.logspace(0,6,7))\\r\",\"    ax.set_title(Title) \\r\",\"\\r\",\"kdeg_range = np.linspace(0,1e6,1000)\\r\",\"R_Ltotal_pH757 = np.array(list(map(fR_Ltotal_pH757, kdeg_range)))\\r\",\"R_Ltotal_pH757_max = kdeg_range[np.sum(np.where(R_Ltotal_pH757 \\u003e 0.0001, 1, 0))]\\r\",\"R_Ltotal_pH757_min = kdeg_range[np.sum(np.where(R_Ltotal_pH757 \\u003e 0.5, 1, 0))]\\r\",\"\\r\",\"R_Ltotal_pH75 = np.array(list(map(fR_Ltotal_pH75, kdeg_range)))\\r\",\"R_Ltotal_pH75_max = kdeg_range[np.sum(np.where(R_Ltotal_pH75 \\u003e 0.0001, 1, 0))]\\r\",\"R_Ltotal_pH75_min = kdeg_range[np.sum(np.where(R_Ltotal_pH75 \\u003e 0.5, 1, 0))]\\r\",\"\\r\",\"R_Ltotal_pH757v = np.array(list(map(fR_Ltotal_pH757v, kdeg_range)))\\r\",\"R_Ltotal_pH757v_max = kdeg_range[np.sum(np.where(R_Ltotal_pH757v \\u003e 0.0001, 1, 0))]\\r\",\"R_Ltotal_pH757v_min = kdeg_range[np.sum(np.where(R_Ltotal_pH757v \\u003e 0.5, 1, 0))]\\r\",\"\\r\",\"C_total_kdeg_plot(R_Ltotal_pH757, \\\"\\\", R_Ltotal_pH757_min, R_Ltotal_pH757_max, kdeg_range)\\r\",\"C_total_kdeg_plot(R_Ltotal_pH75, \\\"\\\", R_Ltotal_pH75_min, R_Ltotal_pH75_max, kdeg_range)\\r\",\"C_total_kdeg_plot(R_Ltotal_pH757v, \\\"\\\", R_Ltotal_pH757v_min, R_Ltotal_pH757v_max, kdeg_range)\\r\",\"\\r\",\"\\r\",\"# plot C_Ltotal with different k_deg\\r\",\"def sim_Ltotal(diff_func, k_deg):\\r\",\"    ode    = ODE(diff_func, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim    = ode.cal_equation(1, k_deg, k_auto, k_meso)\\r\",\"    Ltotal = sim[:,2] + sim[:,3]\\r\",\"    Ltotal = np.concatenate([[C_Ltotal] * 109, Ltotal]).reshape((1110,1))\\r\",\"    return Ltotal\\r\",\"\\r\",\"def C_Ltotal_plot(L1, Title, pHfunc, kmin, kmax):\\r\",\"    np.set_printoptions(suppress=True, precision=2)\\r\",\"    pH  = pHfunc(x).reshape((1110,1))\\r\",\"    res = pd.DataFrame(np.concatenate([pH.T,L1.T])).T\\r\",\"    res.columns =     ['pH', 'L1', 'L2', 'L3']\\r\",\"    x_df = pd.DataFrame(x, columns=['x'])\\r\",\"    res = pd.concat([res, x_df], axis=1)\\r\",\"    \\r\",\"    fig, ax1 = plt.subplots(figsize = (3,3), dpi=300)\\r\",\"    label1 = 'k_deg = {:.0e}'.format(0)\\r\",\"    sns.lineplot(data = res[109:], x='x', y='L1', \\\\\\r\",\"                 label = label1, \\\\\\r\",\"                 color = sns.color_palette(\\\"deep\\\", 6)[0])\\r\",\"    label2 = 'k_deg = {:.0e}'.format(kmin)\\r\",\"    sns.lineplot(data = res[109:], x='x', y='L2', \\\\\\r\",\"                 label = label2, \\\\\\r\",\"                 color = sns.color_palette(\\\"deep\\\", 6)[0])\\r\",\"    label3 = 'k_deg = {:.0e}'.format(kmax)\\r\",\"    sns.lineplot(data = res[109:], x='x', y='L3', \\\\\\r\",\"                 label = label3, \\\\\\r\",\"                 color = sns.color_palette(\\\"deep\\\", 6)[0])\\r\",\"    ax1.set(xlabel ='Height_x (0:SG/SC, 1:SC surface)',ylabel='C_Ltotal (M)',\\\\\\r\",\"            xlim=(0,1), ylim=(-1E-12,1.42e-10))\\r\",\"    ax1.lines[0].set_linestyle(\\\"solid\\\")\\r\",\"    ax1.lines[1].set_linestyle(\\\"dashed\\\")\\r\",\"    ax1.lines[2].set_linestyle(\\\"dotted\\\")\\r\",\"    ax1.set_xticks(np.linspace(0, 1, 6))\\r\",\"    ax2 = ax1.twinx()\\r\",\"    sns.lineplot(data = res, x='x', y='pH', label = 'pH', ax=ax2,\\\\\\r\",\"                 legend=False, color = 'gray')\\r\",\"    ax2.set(xlim=(-0.1, 1), ylim=(-0.1,7.1))\\r\",\"    ax2.lines[0].set_linestyle(\\\"--\\\")\\r\",\"#    ax2.set_yticks(np.linspace(0, 7, 8))\\r\",\"    ax2.set_ylabel('')\\r\",\"    ax2.set_yticks([])\\r\",\"    h1, l1 = ax1.get_legend_handles_labels()\\r\",\"    h2, l2 = ax2.get_legend_handles_labels()\\r\",\"    ax1.legend(h2+h1, l2+l1, loc='best', bbox_to_anchor=(1.9, 1))\\r\",\"    ax1.set_title(Title) \\r\",\"\\r\",\"L1 = np.concatenate([sim_Ltotal(diff_pH5_7step,0),\\r\",\"                     sim_Ltotal(diff_pH5_7step,R_Ltotal_pH757_min),\\r\",\"                     sim_Ltotal(diff_pH5_7step,R_Ltotal_pH757_max)], 1)\\r\",\"L2 = np.concatenate([sim_Ltotal(diff_pH7_5,0),\\r\",\"                     sim_Ltotal(diff_pH7_5,R_Ltotal_pH75_min),\\r\",\"                     sim_Ltotal(diff_pH7_5,R_Ltotal_pH75_max)], 1)\\r\",\"L3 = np.concatenate([sim_Ltotal(diff_pH757v,0),\\r\",\"                     sim_Ltotal(diff_pH757v,R_Ltotal_pH757v_min),\\r\",\"                     sim_Ltotal(diff_pH757v,R_Ltotal_pH757v_max)], 1)\\r\",\"    \\r\",\"    \\r\",\"C_Ltotal_plot(L1,'', pH5_7step, R_Ltotal_pH757_min, R_Ltotal_pH757_max)\\r\",\"C_Ltotal_plot(L2,'', pH7_5, R_Ltotal_pH75_min, R_Ltotal_pH75_max)\\r\",\"C_Ltotal_plot(L3,'', pH757v, R_Ltotal_pH757v_min, R_Ltotal_pH757v_max)\\r\",\"\\r\",\"# --- Range of kauto and kmeso to reproduce qualitative distribution of KLK ---\\r\",\"def f_P1_KLK_pH757(k_auto,k_meso):\\r\",\"    ode     = ODE(diff_pH5_7step, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim     = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    Ktot  = sim[:,1] + sim[:,3]\\r\",\"    P_KLK   = (Ktot[1000] - Ktot[500])/Ktot[500]\\r\",\"    return P_KLK\\r\",\"\\r\",\"def f_P2_KLK_pH757(k_auto,k_meso):\\r\",\"    ode     = ODE(diff_pH5_7step, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim     = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    Ktot  = sim[:,1] + sim[:,3]\\r\",\"    P_KLK   = Ktot[1000]/C_pKLK0\\r\",\"    return P_KLK\\r\",\"\\r\",\"def f_P1_KLK_pH75(k_auto,k_meso):\\r\",\"    ode     = ODE(diff_pH7_5, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim     = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    Ktot  = sim[:,1] + sim[:,3]\\r\",\"    P_KLK   = (Ktot[1000] - Ktot[500])/Ktot[500]\\r\",\"    return P_KLK\\r\",\"\\r\",\"def f_P2_KLK_pH75(k_auto,k_meso):\\r\",\"    ode     = ODE(diff_pH7_5, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim     = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    Ktot  = sim[:,1] + sim[:,3]\\r\",\"    P_KLK   = Ktot[1000]/C_pKLK0\\r\",\"    return P_KLK\\r\",\"\\r\",\"def f_P1_KLK_pH757v(k_auto,k_meso):\\r\",\"    ode     = ODE(diff_pH757v, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim     = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    Ktot  = sim[:,1] + sim[:,3]\\r\",\"    P_KLK   = (Ktot[1000] - Ktot[500])/Ktot[500]\\r\",\"    return P_KLK\\r\",\"\\r\",\"def f_P2_KLK_pH757v(k_auto,k_meso):\\r\",\"    ode     = ODE(diff_pH757v, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim     = ode.cal_equation(1, k_deg, k_auto, k_meso) # x, k_deg, k_auto, k_meso\\r\",\"    Ktot  = sim[:,1] + sim[:,3]\\r\",\"    P_KLK   = Ktot[1000]/C_pKLK0\\r\",\"    return P_KLK\\r\",\"\\r\",\"def sim_profiles(func):\\r\",\"    List_kauto = np.sort(np.array(list(np.logspace(2,7,201))*201))\\r\",\"    List_kmeso = np.array(list(np.logspace(2,7,201))*201)\\r\",\"    res = np.array(list(map(func, List_kauto, List_kmeso)))\\r\",\"    res = res.reshape((201,201))\\r\",\"    res = pd.DataFrame(res)\\r\",\"    res.index   = list(np.array(np.logspace(2,7,201), np.int32))\\r\",\"    res.columns = list(np.array(np.logspace(2,7,201), np.int32))\\r\",\"    return res\\r\",\"    \\r\",\"def P_KLK_plot(P_KLK, Title, label1, cmap1, vmin1, vmax1, tick1):\\r\",\"    fig, ax = plt.subplots(figsize = (5,4), dpi=100)\\r\",\"    sns.heatmap(P_KLK, vmin=vmin1, vmax=vmax1, \\\\\\r\",\"                xticklabels=40, yticklabels=40, \\\\\\r\",\"                cmap=cmap1, cbar_kws={'label': label1, 'ticks': tick1})\\r\",\"    ax.set(xlabel ='k_meso (M-1 s-1)',ylabel='k_auto (M-1 s-1)')\\r\",\"    plt.xticks(rotation=90)\\r\",\"    plt.yticks(rotation=0)\\r\",\"    ax.set_title(Title) \\r\",\"\\r\",\"#k_deg = 0\\r\",\"#k_deg = R_Ltotal_pH757_min\\r\",\"k_deg = R_Ltotal_pH757_max\\r\",\"\\r\",\"P1_KLK_pH757 = sim_profiles(f_P1_KLK_pH757)    \\r\",\"P2_KLK_pH757 = sim_profiles(f_P2_KLK_pH757)\\r\",\"P1a_KLK_pH757 = np.where((0.5 \\u003c P1_KLK_pH757) \\u0026\\\\\\r\",\"                        (P1_KLK_pH757 \\u003c 1.5), 1, 0)\\r\",\"P2a_KLK_pH757 = np.where((P2_KLK_pH757\\u003e0.5), 1, 0)\\r\",\"P3_KLK_pH757 = np.where((0.5 \\u003c P1_KLK_pH757) \\u0026\\\\\\r\",\"                        (P1_KLK_pH757 \\u003c 1.5) \\u0026 \\\\\\r\",\"                        (P2_KLK_pH757\\u003e0.5), 1, 0)\\r\",\"P_KLK_plot(P1_KLK_pH757, \\\"pH757 (stepwise)\\\",'[C_Ktotal(1)-C_Ktotal(0.5)]/[C_Ktotal(0.5)-C_Ktotal(0)]',\\\\\\r\",\"           generate_cmap(['#3C4EC2',\\\\\\r\",\"                          '#E0E1E2',\\\\\\r\",\"                          '#B40426',\\\\\\r\",\"                          '#E0E1E2',\\\\\\r\",\"                          sns.color_palette(\\\"deep\\\", 10)[5]]\\\\\\r\",\"                          ),0, 2, [0, 0.5, 1, 1.5, 2])\\r\",\"#P_KLK_plot(P2_KLK_pH757, \\\"pH757 (stepwise)\\\",'','coolwarm',0, 1, [0, 0.5, 1])\\r\",\"P_KLK_plot(P1a_KLK_pH757, \\\"pH757 (stepwise)\\\",'','coolwarm',0, 1, [0, 1])\\r\",\"P_KLK_plot(P2a_KLK_pH757, \\\"pH757 (stepwise)\\\",'','coolwarm',0, 1, [0, 1])\\r\",\"P_KLK_plot(P3_KLK_pH757, \\\"pH757 (stepwise)\\\",'','coolwarm',0, 1, [0, 1])\\r\",\"\\r\",\"P_KLK_plot(P2_KLK_pH757, \\\"\\\",'C_Ktotal(1)/C_pKLK_SG/SC','coolwarm',0, 1, [0, 0.5, 1])\\r\",\"\\r\",\"P3= pd.DataFrame(P3_KLK_pH757)\\r\",\"P3.index = P1_KLK_pH757.index\\r\",\"P3.columns = P1_KLK_pH757.columns\\r\",\"\\r\",\"#k_deg = 0\\r\",\"#k_deg = R_Ltotal_pH75_min\\r\",\"k_deg = R_Ltotal_pH75_max\\r\",\"\\r\",\"P1_KLK_pH75 = sim_profiles(f_P1_KLK_pH75)\\r\",\"P2_KLK_pH75 = sim_profiles(f_P2_KLK_pH75)\\r\",\"P1a_KLK_pH75 = np.where((0.5 \\u003c P1_KLK_pH75) \\u0026\\\\\\r\",\"                        (P1_KLK_pH75 \\u003c 1.5), 1, 0)\\r\",\"P2a_KLK_pH75 = np.where((P2_KLK_pH75\\u003e0.5), 1, 0)\\r\",\"P3_KLK_pH75 = np.where((0.5 \\u003c P1_KLK_pH75) \\u0026\\\\\\r\",\"                        (P1_KLK_pH75 \\u003c 1.5) \\u0026 \\\\\\r\",\"                        (P2_KLK_pH75\\u003e0.5), 1, 0)\\r\",\"\\r\",\"P_KLK_plot(P1_KLK_pH75, \\\"pH75 (gradient)\\\",'[C_Ktotal(1)-C_Ktotal(0.5)]/[C_Ktotal(0.5)-C_Ktotal(0)]',\\\\\\r\",\"           generate_cmap(['#3C4EC2',\\\\\\r\",\"                          '#E0E1E2',\\\\\\r\",\"                          '#B40426',\\\\\\r\",\"                          '#E0E1E2',\\\\\\r\",\"                          sns.color_palette(\\\"deep\\\", 10)[5]]\\\\\\r\",\"                          ),0, 2, [0, 0.5, 1, 1.5, 2])\\r\",\"#P_KLK_plot(P2_KLK_pH75, \\\"pH75 (gradient)\\\",'C_Ktotal(1)/C_pKLK(0)','coolwarm',0, 1, [0, 0.5, 1])\\r\",\"\\r\",\"P_KLK_plot(P1a_KLK_pH75, \\\"pH75 (gradient)\\\",'C_Ktotal(1)/C_pKLK(0)','coolwarm',0, 1, [0, 1])\\r\",\"P_KLK_plot(P2a_KLK_pH75, \\\"pH75 (gradient)\\\",'C_Ktotal(1)/C_pKLK(0)','coolwarm',0, 1, [0, 1])\\r\",\"P_KLK_plot(P3_KLK_pH75, \\\"pH75 (gradient)\\\",'C_Ktotal(1)/C_pKLK(0)','coolwarm',0, 1, [0, 1])\\r\",\"\\r\",\"P_KLK_plot(P2_KLK_pH75, \\\"\\\",'C_Ktotal(1)/C_pKLK(0)','coolwarm',0, 1, [0, 0.5, 1])\\r\",\"\\r\",\"P3= pd.DataFrame(P3_KLK_pH75)\\r\",\"P3.index = P1_KLK_pH75.index\\r\",\"P3.columns = P1_KLK_pH75.columns\\r\",\"\\r\",\"#k_deg = 0\\r\",\"#k_deg = R_Ltotal_pH757v_min\\r\",\"k_deg = R_Ltotal_pH757v_max\\r\",\"\\r\",\"P1_KLK_pH757v = sim_profiles(f_P1_KLK_pH757v)    \\r\",\"P2_KLK_pH757v = sim_profiles(f_P2_KLK_pH757v)\\r\",\"P1a_KLK_pH757v = np.where((0.5 \\u003c P1_KLK_pH757v) \\u0026\\\\\\r\",\"                        (P1_KLK_pH757v \\u003c 1.5), 1, 0)\\r\",\"P2a_KLK_pH757v = np.where((P2_KLK_pH757v\\u003e0.5), 1, 0)\\r\",\"P3_KLK_pH757v = np.where((0.5 \\u003c P1_KLK_pH757v) \\u0026\\\\\\r\",\"                        (P1_KLK_pH757v \\u003c 1.5) \\u0026 \\\\\\r\",\"                        (P2_KLK_pH757v\\u003e0.5), 1, 0)\\r\",\"P_KLK_plot(P1_KLK_pH757v, \\\"pH757 (gradient)\\\",'[C_Ktotal(1)-C_Ktotal(0.5)]/[C_Ktotal(0.5)-C_Ktotal(0)]',\\\\\\r\",\"           generate_cmap(['#3C4EC2',\\\\\\r\",\"                          '#E0E1E2',\\\\\\r\",\"                          '#B40426',\\\\\\r\",\"                          '#E0E1E2',\\\\\\r\",\"                          sns.color_palette(\\\"deep\\\", 10)[5]]\\\\\\r\",\"                          ),0, 2, [0, 0.5, 1, 1.5, 2])\\r\",\"#P_KLK_plot(P2_KLK_pH757v, \\\"pH757 (gradient)\\\",'','coolwarm',0, 1, [0, 0.5, 1])\\r\",\"P_KLK_plot(P1a_KLK_pH757v, \\\"pH757 (gradient)\\\",'','coolwarm',0, 1, [0, 1])\\r\",\"P_KLK_plot(P2a_KLK_pH757v, \\\"pH757 (gradient)\\\",'','coolwarm',0, 1, [0, 1])\\r\",\"P_KLK_plot(P3_KLK_pH757v, \\\"pH757 (gradient)\\\",'','coolwarm',0, 1, [0, 1])\\r\",\"\\r\",\"P_KLK_plot(P2_KLK_pH757v, \\\"\\\",'C_Ktotal(1)/C_pKLK_SG/SC','coolwarm',0, 1, [0, 0.5, 1])\\r\",\"\\r\",\"P3= pd.DataFrame(P3_KLK_pH757v)\\r\",\"P3.index = P1_KLK_pH757v.index\\r\",\"P3.columns = P1_KLK_pH757v.columns\\r\",\"\\r\",\"\\r\",\"# plot E_KLK with different k_auto/meso\\r\",\"def sim_Ktotal(diff_func, pH_func, k_auto, k_meso):\\r\",\"    ode    = ODE(diff_func, [C_pKLK0, C_KLK0, C_Ltotal, 0])\\r\",\"    sim    = ode.cal_equation(1, k_deg, k_auto, k_meso)\\r\",\"    Ktotal = sim[:,1] + sim[:,3]\\r\",\"    Ktotal = np.concatenate([[C_pKLK0] * 109, Ktotal]).reshape((1110,1))\\r\",\"    return Ktotal\\r\",\"\\r\",\"# p:pH757stepwise, q:pH75 gradient, r: pH757v\\r\",\"p1 = [1e+2,   2.3e+4] #100, all: 22387-44668\\r\",\"p2 = [1e+2,   4.4e+4] #100, all: 22387-44668\\r\",\"p3 = [1e+5,   3e+4] #1e5, kdeg=0: 13335-44668, min/max: 12589-44668, kdeg_max: \\r\",\"p4 = [1.6e+6, 1e+2] #,100 kged0/min: 1584893-1678804, max: 1496235-1678804\\r\",\"p5 = [1e+3,   1e+3]\\r\",\"p6 = [1e+6,   1e+6] \\r\",\" \\r\",\"q1 = [1e+2, 2e+4] # 100  all:17782-33496\\r\",\"q2 = [1e+2, 3e+4] # 100  all:17782-33496\\r\",\"q3 = [1e+5, 1.6e+4] # 1e5, k0:7079-25118, min7079-26607, max7943-25118\\r\",\"q4 = [5.95662e+5, 1e+2] #,100  k0:595662-668343, min:595662-630957, max 562341-595662\\r\",\"q5 = [1e+3, 1e+3] #\\r\",\"q6 = [1e+6, 1e+6] #\\r\",\"\\r\",\"r1 = [1e+2, 2.2e+4] # 100, all 21134-37583,\\r\",\"r2 = [1e+2, 3.7e+4] # 100, all 21134-37583,\\r\",\"r3 = [1e+5, 2.3e+4] # 1e5, k0 11885-35481,min 11220-37583, max 10592-35481\\r\",\"r4 = [1.1e+6, 1e+2] # ,100 k0min:1059253-1188502,max 1000000-1122018\\r\",\"r5 = [1e+3, 1e+3] #\\r\",\"r6 = [1e+6, 1e+6] #\\r\",\"\\r\",\"def evaluate_series(sim_func, diff_func, step_func, p1, p2, p3, p4, p5, p6):\\r\",\"    res = np.concatenate([sim_func(diff_func, step_func, p1[0], p1[1]),\\r\",\"                          sim_func(diff_func, step_func, p2[0], p2[1]),\\r\",\"                          sim_func(diff_func, step_func, p3[0], p3[1]),\\r\",\"                          sim_func(diff_func, step_func, p4[0], p4[1]),\\r\",\"                          sim_func(diff_func, step_func, p5[0], p5[1]),\\r\",\"                          sim_func(diff_func, step_func, p6[0], p6[1])], 1)\\r\",\"    return res\\r\",\"\\r\",\"def Ktotal_plot(K0, K1, K2, Title, Y_label, Y_max, pHfunc, p1, p2, p3, p4, p5, p6, degmin, degmax, Anchor):\\r\",\"    pH  = pHfunc(x).reshape((1110,1))\\r\",\"    res = pd.DataFrame(np.concatenate([pH.T,K1.T])).T\\r\",\"    res.columns =     ['pH', 'K1', 'K2', 'K3', 'K4', 'K5', 'K6']\\r\",\"    x_df = pd.DataFrame(x, columns=['x'])\\r\",\"    res = pd.concat([res, x_df], axis=1)\\r\",\"\\r\",\"    res2 = pd.DataFrame(np.concatenate([pH.T,K2.T])).T\\r\",\"    res2.columns =     ['pH', 'K1', 'K2', 'K3', 'K4', 'K5', 'K6']\\r\",\"    x_df2 = pd.DataFrame(x, columns=['x'])\\r\",\"    res2 = pd.concat([res2, x_df2], axis=1)\\r\",\"\\r\",\"    res0 = pd.DataFrame(np.concatenate([pH.T,K0.T])).T\\r\",\"    res0.columns =     ['pH', 'K1', 'K2', 'K3', 'K4', 'K5', 'K6']\\r\",\"    x_df0 = pd.DataFrame(x, columns=['x'])\\r\",\"    res0 = pd.concat([res0, x_df0], axis=1)\\r\",\"    \\r\",\"    fig, ax1 = plt.subplots(figsize = (3,3), dpi=300)\\r\",\"    label01 = '[k_deg, k_auto,k_meso] = [{0:.0e}, {1:.0e}, {2:.0e}] '.format(0, p1[0], p1[1])\\r\",\"    sns.lineplot(data = res0[109:], x='x', y='K1', \\\\\\r\",\"                 label = label01,\\\\\\r\",\"                 color = sns.color_palette(\\\"bright\\\", 8)[1])\\r\",\"    label02 = '[k_deg, k_auto,k_meso] = [{0:.0e}, {1:.0e}, {2:.0e}] '.format(0, p2[0], p2[1])\\r\",\"    sns.lineplot(data = res0[109:], x='x', y='K2', \\\\\\r\",\"                 label = label02,\\\\\\r\",\"                 color = sns.color_palette(\\\"bright\\\", 8)[2])\\r\",\"    label03 = '[k_deg, k_auto,k_meso] = [{0:.0e}, {1:.0e}, {2:.0e}] '.format(0, p3[0], p3[1])\\r\",\"    sns.lineplot(data = res0[109:], x='x', y='K3', \\\\\\r\",\"                 label = label03,\\\\\\r\",\"                 color = sns.color_palette(\\\"bright\\\", 8)[4])\\r\",\"    label04 = '[k_deg, k_auto,k_meso] = [{0:.0e}, {1:.0e}, {2:.0e}] '.format(0, p4[0], p4[1])\\r\",\"    sns.lineplot(data = res0[109:], x='x', y='K4', \\\\\\r\",\"                 label = label04,\\\\\\r\",\"                 color = sns.color_palette(\\\"bright\\\", 8)[5])\\r\",\"    label05 = '[k_deg, k_auto,k_meso] = [{0:.0e}, {1:.0e}, {2:.0e}] '.format(0, p5[0], p5[1])\\r\",\"    sns.lineplot(data = res0[109:], x='x', y='K5', \\\\\\r\",\"                 label = label05,\\\\\\r\",\"                 color = sns.color_palette(\\\"bright\\\", 8)[0])\\r\",\"    label06 = '[k_deg, k_auto,k_meso] = [{0:.0e}, {1:.0e}, {2:.0e}] '.format(0, p6[0], p6[1])\\r\"